# coding=utf-8
class Solution1(object):
    def strStr(self, haystack, needle):
        """
        :type haystack: str
        :type needle: str
        :rtype: int
        """
        # 此处为边界条件
        if needle == "":
            return 0

        found = False
        for i in range(0, len(haystack)):
            for j in range(0, len(needle)):
                # 此处为优化点
                if i + j > len(haystack) - 1:
                    return -1
                elif haystack[i + j] != needle[j]:
                    break
                elif j == len(needle) - 1:
                    found = True
            if found:
                break

        if found:
            return i
        else:
            return -1


